import s from './AuthButtons.module.css';


const AuthButtons = () => {
    return (
        <div className={s.btn_group}>
        <NavLink to="/" className={s.btn_sign}>
          Sign In
        </NavLink>
        <NavLink to="/" className={s.btn_reg}>
          Register
        </NavLink>
      </div>
    );
  }

  export default AuthButtons;
